import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import { useLocation } from "react-router-dom";
import Tabla from "../componentes/tablas/Tabla";

const CaballerizaDetail = () => {
  const location = useLocation();
  const {
    props: { entrenador, veterinario, numero, total, disponible },
  } = location.state;

  let columnas1 = (
    <tr>
      <th>Nombre</th>
      <th>Puesto</th>
      <th>Fecha_Ingreso</th>
      <th>Stud</th>
    </tr>
  );

  const ejemplares = [
    {
      id: "1",
      nombre: "Black Mamba",
      stud: "PAPA PEDRO",
      puesto: 45,
      fecha_ingreso: "27/12/2022",
    },
    {
      id: "2",
      nombre: "Black Mamba",
      stud: "PAPA PEDRO",
      puesto: 45,
      fecha_ingreso: "27/12/2022",
    },
    {
      id: "3",
      nombre: "Black Mamba",
      stud: "PAPA PEDRO",
      puesto: 45,
      fecha_ingreso: "27/12/2022",
    },
    {
      id: "4",
      nombre: "Black Mamba",
      stud: "PAPA PEDRO",
      puesto: 45,
      fecha_ingreso: "27/12/2022",
    },
    {
      id: "5",
      nombre: "Black Mamba",
      stud: "PAPA PEDRO",
      puesto: 45,
      fecha_ingreso: "27/12/2022",
    },
    {
      id: "6",
      nombre: "Black Mamba",
      stud: "PAPA PEDRO",
      puesto: 45,
      fecha_ingreso: "27/12/2022",
    },
  ];

  return (
    <Container>
      <Row>
        <Col className="justify-content-center align-items-center mx-5">
          <Card>
            <Card.Body>
              <Row className="d-flex justify-content-center">
                <Col
                  className="col col-auto rounded-start rounded-end"
                  style={{ backgroundColor: "#6376D4" }}
                >
                  <h1>{`Caballeriza Nro. ${numero}`}</h1>
                </Col>
              </Row>

              <Row className="row row-cols-2 mt-3">
                <Col className="col-6 ms-2">
                  <Tabla
                    titulo="EJEMPLARES DE LA CABALLERIZA"
                    columnas={columnas1}
                    informacion={ejemplares}
                    funcion={(x) => (
                      <tr>
                        <td>{`${x.nombre}`}</td>
                        <td>{`${x.puesto}`}</td>
                        <td>{`${x.fecha_ingreso}`}</td>
                        <td>{`${x.stud}`}</td>
                      </tr>
                    )}
                  ></Tabla>
                </Col>

                <Col className="col-5" style={{width: "495px"}}>
                  <Row className=" row-cols-2 d-flex justify-content-center mt-5" style={{height: "35px"}}>
                    <Col style={{ backgroundColor: "#6376D4"}} className='rounded-start rounded-end col-4 text-center d-flex align-items-center'><h6>{`Entrenador: ${entrenador}`}</h6></Col>

                    <Col style={{ backgroundColor: "#6376D4" }} className='rounded-start rounded-end col-4 ms-3 text-center d-flex align-items-center'><h6>{`Veterinario: ${veterinario}`}</h6></Col>
                  </Row>

                  <Row className="row row-cols-2 d-flex justify-content-center mt-5" style={{height: "35px"}}>
                    <Col style={{ backgroundColor: "#6376D4" }} className='rounded-start rounded-end col-auto d-flex align-items-center'><h6>{`Total Puestos: ${total}`}</h6></Col>

                    <Col style={{ backgroundColor: "#6376D4" }} className='rounded-start rounded-end col-auto ms-3 d-flex align-items-center'><h6>{`Disponibles: ${disponible}`}</h6></Col>
                  </Row>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default CaballerizaDetail;
